import "./index.css";
import logo from "./images/logo.svg";

export default function App() {
  return (
    <div className="container">
      <div>
        {" "}
        <img src={logo} alt="logo" />
      </div>
      <Bill />
      <Result />
    </div>
  );
}

function Bill() {
  return (
    <div className="bill">
      Bill Select Tip % 5% 10% 15% 25% 50% Custom Number of People
    </div>
  );
}

function Result() {
  return <div className="result">Tip Amount / person Total / person Reset</div>;
}
